// import Component
import Header from './components/Header';
import AnimRoutes from './components/AnimRoutes';
import { BrowserRouter as Router } from 'react-router-dom';
import { motion } from 'framer-motion';
import CursorContext from './context/CursorContext';

const App = () => {
  const { cursorVariants } = useContext(CursorContext); // Correctly using useContext

  console.log(cursorVariants); // Changed from cursorContext to cursorVariants

  return (
    <Router>
      <motion.div
        variants={cursorVariants}
        animate="default, " // Corrected formatting
        initial="hidden"
        exit="hidden"
      >
        <Header />
        <AnimRoutes />
      </motion.div>
    </Router>
  );
};

export default App;
